import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./css/style.css";
const App = () => {
  const navigate = useNavigate();
  const [imgarray, setImgArray] = useState([
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
