    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
    { url: "./images/t3.png" },
  ]);
  return (
    <>
      <div className="row1">
        <label>CLUB SITES</label>
        <div className="imagegroup">
          {imgarray.map((itm) => {
            return <img className="topimage" src={require(`${itm.url}`)} />;
          })}
        </div>
      </div>
      <div className="row2">
        <div className="left">
        <label>Premier League</label>
        <label>Fantasy</label>
        <label>Video</label>
        <label>Communities</label>
        <label>More</label></div>
        <div className="right">
          <label>No Room For Racism</label>
          <label>Signin</label>
          
        </div>
      </div>
    </>
  );
};
export default App;
